import React from 'react';
import {
  Text,
  View,
  StyleSheet,
  Button,
} from 'react-native';

// shared components
import Heading from 'components/shared/Heading';

const styles = StyleSheet.create({
  container: {
    flex: 1,
    // justifyContent: 'center',
    backgroundColor: 'lightblue', // '#ecf0f1',
    padding: 8,
    paddingTop: 50,
  },
});

function PromptScreen({ navigation, route }) {
  console.log('route.params: ', route.params);
  const { cardId } = route.params;
  const view = (
    <View style={styles.container}>
      <Text>Prompt Screen { cardId }</Text>
      <Button
        title="Go to next Prompt"
        onPress={() => navigation.push('Prompt', {
          cardId: cardId + 1,
        })}
      />
      {/*
        <Button title="Go to WelcomeScreen" onPress={() => navigation.navigate('Welcome')} />
        <Button title="Go back" onPress={() => navigation.goBack()} />
      */}
    </View>
  );
  return view;
}

export default PromptScreen;
